import React, { createContext, useState } from 'react'


const DataInfo = createContext();

export default function GlobalContext(props) {
    const[UserData, setUserData]=useState({
        name: "niyam",
        noOfLeaves: "25"
    });
  return (
 <DataInfo.Provider>
    value ={{
        data:[UserData, setUserData],
    }}
    {props.children}
 </DataInfo.Provider>
  )
}
